import React from 'react';
import Navbar from '../Navbar/Navbar';
import './Home.css';
import PreviewMainfo from '../PreviewMaininfo/PreviewMaininfo';
import Infoshow from '../Infoshow/Infoshow';
import Bottonfocus from '../Bootonfocus/Bottonfocus';
import imageSrc from './../../images/imagescontent/almuerzopic.webp';

function Home() {
  return (
    <div className="homepart">
      <div className="background-section">
        <Navbar />
        <h1>Bienvenid@</h1>
      </div>

      <PreviewMainfo 
        imageSrc={imageSrc}
        text="Noticias"
      />
      <Infoshow />
      <Bottonfocus />
      <Bottonfocus />
    </div>
  );
}

export default Home ;
